export class EmployeeUsersComponent extends React.PureComponent{


    render(){
        let name = this.props.users.firstName + " " + this.props.users.lastName;
        return(
            <>
                <tr>
                    <td>{this.props.users.userID}</td>
                    <td>{name}</td>
                    <td>{this.props.users.username}</td>
                    <td>{this.props.users.email}</td>
                    <td>{this.props.users.userRole}</td>
                    {/* <td><button id={this.props.users.userID} onClick={this.deleteUser}  className="delete_user_button"> <FaTrashAlt/> </button></td>
                    <td><button id={this.props.users.userID} onClick={this.editUser} className="edit_user_button"><FiSave/></button></td> */}
                    {/* <td><button value="choicolate" id={this.props.users.userID} onClick={this.buttonClicked} className="btn btn-player">Delete</button></td> */}
                </tr>
            </>
        )
    }
}
